`}},{name:"posts-air-conditioner",path:"/posts/air-conditioner",component:i1,props:!0,meta:{frontmatter:{title:"云空调，便携小空调",date:"2021-04-18T01:18:47+08:00",updated:"2021-04-22T01:18:47+08:00",tags:["玩具","前端","React"],categories:["云游的小项目"],wordCount:"1.3k",readingTime:6},layout:"post",excerpt:`<p><a href="https://github.com/YunYouJun/air-conditioner/" target="_blank" rel="noreferrer"><img src="https://img.shields.io/github/stars/YunYouJun/air-conditioner?style=social" alt="GitHub Repo stars"></a></p>
